import {BrowserRouter} from 'react-router-dom';



  ReactDOM.render(
    <React.StrictMode>
      <BrowserRouter>	
         <PreAppFirst/>
      </BrowserRouter>	
    </React.StrictMode>,
  document.getElementById('root')
  );

